// Header.js
import React from 'react';
import Typography from '@mui/material/Typography';

function Header() {
  return (
    <div>
      <img src="/kaiburrLogoText.png" alt="Logo" />
      
      <Typography variant="h4">Web UI Front End</Typography>
    </div>
  );
}

export default Header;
